import React from "react";
import Navbar from "./components/Navbar";
import Jumbotron from "./components/Jumbotron";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";

function Profile() {
  return (
    <Router>
      <div>
        <Navbar />
        <Jumbotron />
      </div>
    </Router>
  );
}

export default Profile;
